import React from 'react'
import {data} from "../../store/store";
import s from "./Product.module.css"



const Product = (props)=> {
        //let title = this.state.qty.map((title) => <div>{title.title}</div>);
        //let picture = this.state.qty.map((picture) => <img srs={picture.image_main}/>);
    console.log(props)
        return (
            <div className={s.container-product}>
                <div>{props.el.title} </div>
                <img src={props.el.image_main}  alt="ddd"/>

                <button onClick={props.removeElement.bind(null, props.el)}>
                    Delete
                </button>
            </div>
        );
}



export default Product;
